'use client'

import React, { useState, useEffect } from "react";
import { useNavigate, useLocation } from "react-router-dom";
import logo from './assets/logo.jpeg';
import perfilIcon from './assets/perfil.png';
import { Menu, X, User, LogOut, Settings } from 'lucide-react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Navbar.css';

const Navbar = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const isAdmin = localStorage.getItem('isAdmin') === 'true';
  const [nombreUsuario, setNombreUsuario] = useState('');
  const [isNavOpen, setIsNavOpen] = useState(false);

  useEffect(() => {
    const nombre = localStorage.getItem('nombre');
    setNombreUsuario(nombre || 'Invitado');
  }, []);

  const handleLogout = () => {
    localStorage.clear();
    setNombreUsuario('Invitado');
    navigate('/login');
  };

  const handleProfileClick = () => {
    navigate('/configuracion-perfil');
  };

  const isActive = (path) => {
    return location.pathname === path;
  };

  const toggleNav = () => {
    setIsNavOpen(!isNavOpen);
  };

  return (
    <nav className="navbar custom-navbar">
      <div className="navbar-container">
        <div className="navbar-brand">
          <img src={logo} alt="Logo" className="navbar-logo" />
          <span className="navbar-title">Mario Hugo</span>
        </div>

        <div className={`navbar-menu ${isNavOpen ? 'is-active' : ''}`}>
          <div className="navbar-start">
            <a className={`navbar-item ${isActive('/inicio') ? 'is-active' : ''}`} href="/inicio">Inicio</a>
            <a className={`navbar-item ${isActive('/catalogo') ? 'is-active' : ''}`} href="/catalogo">Catálogo</a>
            <a className={`navbar-item ${isActive('/historial') ? 'is-active' : ''}`} href="/historial">Historial</a>
            {isAdmin && (
              <>
                <a className={`navbar-item ${isActive('/libros') ? 'is-active' : ''}`} href="/libros">Libros</a>
                <a className={`navbar-item ${isActive('/usuarios') ? 'is-active' : ''}`} href="/usuarios">Usuarios</a>
              </>
            )}
          </div>

          <div className="navbar-end">
            <div className="navbar-item has-dropdown is-hoverable">
              <a className="navbar-link">
                <img src={perfilIcon} alt="Perfil" className="profile-icon" />
                <span className="profile-name">{nombreUsuario}</span>
              </a>

              <div className="navbar-dropdown">
                <a className="navbar-item" onClick={handleProfileClick}>
                  <User size={18} />
                  <span>Perfil</span>
                </a>
                <a className="navbar-item" onClick={handleLogout}>
                  <LogOut size={18} />
                  <span>Cerrar Sesión</span>
                </a>
              </div>
            </div>
          </div>
        </div>

        <button className="navbar-burger" aria-label="menu" aria-expanded="false" onClick={toggleNav}>
          {isNavOpen ? <X /> : <Menu />}
        </button>
      </div>
    </nav>
  );
};

export default Navbar;
